    defaultZoom={8}
    defaultCenter={{lat:-34.397,lng:150.644}}
    >
      <Marker position = {{lat:34.397,lng:150.644}} />
    </GoogleMap>
    return ( 
      <MapWithMarker
      googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyBC8r72KNZPJs_zBcQiHe2BtDqx86k0F1M&v=3.exp&libraries=geometry,drawing,places"
      loadingElement={<div style={{ height: `100%` }} />}
      containerElement={<div style={{ height: `400px` }} />}
      mapElement={<div style={{ height: `100%` }} />}
    />
     );
  }
}
 
export default Api;
